class Solution(object):
    def maxOperations(self, s):
        """
        :type s: str
        :rtype: int
        """

        moves = 0
        prev_visited = 0

        for i in range(len(s) - 1):
            if s[i] == '1':
                prev_visited += 1
                if s[i + 1] == '0':
                    moves = moves + prev_visited
        return moves
